        <div class="col-md-6">
          <div class="passengers-form">
            <div class="form-header">
              <h1>Szczegóły rezerwacji</h1>
            </div>

            <form #passengersInfoForm="ngForm" (ngSubmit)="save(passengersInfoForm)">
              <div class="row" *ngFor=" let passenger of passengers; let i = index">
                <h5>Pasażer {{i+1}}</h5>
                <div class="col-md-6">
                  <div class="form-group form-floating">
                    <input class="form-control" type="text" #name="ngModel" [name]="'name_'+1"  [(ngModel)]="passenger.name"  required/>
                    <label  for="name" class="form-label">Imię i nazwisko </label>
                  </div>
                </div>
  
                <div class="col-md-6">
                  <div class="form-group form-floating">
                    <select class="form-select" id="luggage" [name]="'luggage_'+1" #luggage="ngModel" [(ngModel)]="passenger.luggage">
                      <option  selected  value="">Podręczny (0zł)</option>
                      <option value="rejestrowany">Rejestrowany do 15kg (170zł)</option>
                    </select>
                    <label for="luggage">Bagaż: </label>
                  </div>
                </div>
                </div>
                <div class="row">
                    <span>Ilość pasażerów: {{ flyData.passengersN }}</span>
                    <span>Wybrane miejsca:</span>
                    <span *ngFor="let seat of flyData.bookedS">{{ seat }}</span>
                    <span *ngIf="seatsLeft > 0">Wybierz jeszcze {{ seatsLeft }} </span>
                </div>
                <div class="row">
                  <div class="form-btn">
                    <button type="submit" class="submit-btn" [disabled]="!passengersInfoForm.valid">Rezerwuj</button>
                  </div>
                </div>
              </form>
          </div>
        </div>
    </div>
</div>
